.cube3d {
  perspective: 0px;
  width: 50vh;
  height: 50vh;
  perspective-origin: 50%; }

.cube {
  position: absolute;
  width: 50vh;
  height: 50vh;
  transform-style: preserve-3d;
  transition: transform 1s; }
  .cube .back {
    position: absolute;
    width: 50vh;
    height: 50vh;
    transform-style: preserve-3d;
    transform: translateZ(-25vh) rotateY(180deg);
    background: #d5b06b; }
  .cube .right {
    position: absolute;
    width: 50vh;
    height: 50vh;
    transform-style: preserve-3d;
    transform: rotateY(-270deg) translateX(25vh);
    background: #b99c65;
    transform-origin: top right; }
  .cube .left {
    position: absolute;
    width: 50vh;
    height: 50vh;
    transform-style: preserve-3d;
    transform: rotateY(270deg) translateX(-25vh);
    background: #9f895f;
    transform-origin: center left; }
  .cube .top {
    position: absolute;
    width: 50vh;
    height: 50vh;
    transform-style: preserve-3d;
    transform: rotateX(-90deg) translateY(-25vh);
    background: #867958;
    transform-origin: top center; }
  .cube .bottom {
    position: absolute;
    width: 50vh;
    height: 50vh;
    transform-style: preserve-3d;
    transform: rotateX(90deg) translateY(25vh);
    background: #706951;
    transform-origin: bottom center; }
  .cube .front {
    position: absolute;
    width: 50vh;
    height: 50vh;
    transform-style: preserve-3d;
    transform: translateZ(25vh);
    background: #5b5b4b; }

