ul {
  position: relative;
  float: left; }
  ul > ul {
    width: calc(100% - 1vh);
    margin-left: 1vh; }
  ul > li:before {
    position: relative;
    padding: .25vh;
    margin: .25vh;
    content: '';
    color: #233837;
    line-height: 1vh;
    font-size: 1vh;
    text-align: center;
    display: inline-block;
    background: #fef6eb;
    border: 0.1vh solid #233837;
    background-repeat: no-repeat;
    background-position: center;
    background-size: cover;
    z-index: 1; }
  ul > li {
    counter-increment: item;
    position: relative;
    width: 100%;
    float: left; }

