  position: relative;
  width: calc(100% - 10vh);
  margin: 2vh 5vh 0;
  float: left; }
  ol > li:after {
    position: absolute;
    left: -.5vh;
    top: -.5vh;
    padding: 1vh;
    content: counter(item);
    border-radius: 100%;
    color: #233837;
    width: 2.5vh;
    height: 2.5vh;
    line-height: 2.5vh;
    font-size: 2vh;
    text-align: center;
    display: inline-block;
    background: #fef6eb;
